commits.sourceNew:
/** Returns a clone of this query. */
public Object clone() {
  try {
    return (Query)super.clone();
  } catch (CloneNotSupportedException e) {
    throw new RuntimeException(e);
  }
}

/** Returns a clone of this query. */
public Object clone() {
  try {
    return (Query)super.clone();
  } catch (CloneNotSupportedException e) {
    throw new RuntimeException("Clone not supported: " + e.getMessage());
  }
}

